import logo from './Ping Pong Table.jpg';
import './App.css';
import { incrementScore } from './ScoreHandling';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div id="Pocket Player" style={{position: 'fixed', top: '13%', width: '100%'}}>
          <div id="Player1" className="Player-score" onClick={incrementScore('Player1')}>00</div>
          <button className="Paddle-button">
            J
          </button>
        </div>
        <div id="Scoring Players" style={{position: 'fixed', top: '78%', display: 'flex', justifyContent: 'space-between', width: '70%'}}>
          <div class="Player-score">00</div>
          <button className="Paddle-button" id="PlayerLeft">
            R
          </button>
          <div class="Player-score">00</div>
          <button className="Paddle-button" id="PlayerRight">
            D
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
